using Aay05;
using Xunit;

namespace Tests.Day05
{
    public class Day5Part2Tests
    {
        string actualData = "";

        [Fact]
        public void ActualTest()
        {
            char[] alpha = new char[] { 'a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z' };
            string shortestPolymer = null;

            foreach (char c in alpha)
            {
                var purged = PolymerReactionManager.Purge(actualData, c);

                var result = PolymerReactionManager.React(purged);

                if (shortestPolymer == null || result.Length < shortestPolymer.Length)
                {
                    shortestPolymer = result;
                }
            }

            Assert.Equal(5446, shortestPolymer.Length);
        }

        [Fact]
        public void PurgeA()
        {
            var sampleData = "dabAcCaCBAcCcaDA";

            var result = PolymerReactionManager.Purge(sampleData, 'A');

            Assert.Equal(10, result.Length);
            Assert.Equal("dbcCCBcCcD", result);

            var collapsed = PolymerReactionManager.React(result);
            Assert.Equal("dbCBcD", collapsed);
        }

        [Fact]
        public void PurgeB()
        {
            var sampleData = "dabAcCaCBAcCcaDA";

            var result = PolymerReactionManager.Purge(sampleData, 'B');

            Assert.Equal(14, result.Length);
            Assert.Equal("daAcCaCAcCcaDA", result);

            var collapsed = PolymerReactionManager.React(result);
            Assert.Equal("daCAcaDA", collapsed);
        }

        [Fact]
        public void PurgeC()
        {
            var sampleData = "dabAcCaCBAcCcaDA";

            var result = PolymerReactionManager.Purge(sampleData, 'C');

            Assert.Equal(10, result.Length);
            Assert.Equal("dabAaBAaDA", result);

            var collapsed = PolymerReactionManager.React(result);
            Assert.Equal("daDA", collapsed);
        }

        [Fact]
        public void PurgeD()
        {
            var sampleData = "dabAcCaCBAcCcaDA";

            var result = PolymerReactionManager.Purge(sampleData, 'D');

            Assert.Equal(14, result.Length);
            Assert.Equal("abAcCaCBAcCcaA", result);

            var collapsed = PolymerReactionManager.React(result);
            Assert.Equal("abCBAc", collapsed);
        }
    }
}
